-- Question 1: Identify dealership total sales is significantly higher than overall average sale price across all delarships
-- I will use (COUNT) to know total Transactions by each dealership
-- I will get total revenue(sales) by price of transaction table
-- and use average to calculates the average sale price per transaction and rounds it to 2 decimal places

SELECT 
d.dealership_id  , -- displays dealership id 
d.name AS Dealership_Name , -- displays dealership name
SUM(t.price) AS Total_sales , 
AVG(t.price) AS Average_Sale_price  
-- I will use INNER JOIN to only get matched rows from both tables transactions & dealerships
FROM transactions AS t 
INNER JOIN dealerships AS d ON t.dealership_id = d.dealership_id
GROUP BY d.dealership_id, d.name
HAVING 
  SUM(t.price) > (
     SELECT AVG(total_price) FROM  (
              SELECT SUM(price) AS total_price
              FROM transactions
              GROUP BY dealership_id) AS Avg_dealership_saless 
              );

-- Question 2:For each dealership, show the top 5 vehicle makes by revenue contribution (percentage and total)
-- i will use WITH statment to create a virtual/temporary/logical table called dealership_make_revenue
-- i will use SUM to get total revenuee generated by each dealership

WITH dealership_make_revenue AS (
   SELECT t.dealership_id , v.make ,
   SUM(t.price) AS Make_revenue
   FROM transactions AS t   -- i will use INNER join to get matched rows only from both tables (transactions & vehicles)
   INNER JOIN vehicles AS v ON t.vin = v.vin -- On the fk that links both tables
   GROUP BY t.dealership_id , v.make ) ,
dealership_revenue_total AS (
   SELECT dealership_id,
   SUM(price) AS Total_revenue
   FROM transactions 
   GROUP BY dealership_id
)
SELECT dmr.dealership_id , -- displays dealership id in dealership_make_revenue  table
d.name AS Dealership_Name , -- displays dealership name
dmr.make , dmr.Make_revenue,
ROUND((dmr.Make_revenue/ drt.Total_revenue)*100,2) AS Revenue_percentage
FROM dealership_make_revenue AS dmr 
INNER JOIN dealership_revenue_total AS drt ON dmr.dealership_id = drt.dealership_id
INNER JOIN dealerships AS d ON dmr.dealership_id = d.dealership_id
WHERE 
 ( SELECT COUNT(*)
   FROM dealership_make_revenue AS sub 
   WHERE sub.dealership_id = dmr.dealership_id AND sub.Make_revenue > dmr.Make_revenue
) < 5
ORDER BY dmr.dealership_id , Revenue_percentage DESC;
      
-- Question 3: For each dealership, calculate unique customers per year and market acquisition percentage
-- I will use YEAR to get the calenader year from transaction date 
-- i will use COUNT & DISTINCT to know the number of different customers bought from that dealership in that year
-- WITH statment to create temporary table

WITH Yearly_Customers AS(
  SELECT dealership_id, 
  YEAR(date) as Yearr, 
  COUNT(DISTINCT customer_id) AS Unique_Customers
  FROM transactions
  GROUP BY dealership_id , YEAR(date) 
 ),
Total_Cust_by_year AS(
   SELECT YEAR(date) AS Yearr ,
   COUNT(DISTINCT customer_id) AS Total_Customers
   FROM transactions
   GROUP BY YEAR(date)
)
SELECT yc.dealership_id,
    d.name AS Dealership_Name , 
    yc.Yearr , yc.Unique_Customers,
    ROUND((yc.Unique_Customers/tcp.Total_Customers)*100,2) AS market_acquisition_percentage
    FROM Yearly_Customers AS yc 
    INNER JOIN Total_Cust_by_year AS tcp ON yc.Yearr = tcp.Yearr 
    INNER JOIN dealerships AS d ON yc.dealership_id = d.dealership_id
ORDER BY yc.Yearr , yc.dealership_id ;

